import React from 'react';
import { Link } from 'react-router-dom';
import { List } from 'semantic-ui-react';

// MainNav on oma komponenttinsa, sisältää NavBar:in päävalikon.
// Kirjautuneen käyttäjän mukaan (admin/tavallinen) näytetään eri MainNav
const MainNav = () => {
  let loggedIn = true;

  return (
    <div>
      {loggedIn ? (
        <List>
          <List.Item>
            <Link to='/'>Kasino</Link>
          </List.Item>
          <List.Item>
            <Link to='/saldo'>Saldo</Link>
          </List.Item>
          <List.Item>
            <Link to='/luotunnus'>Luo tunnus</Link>
          </List.Item>
          <List.Item>
            <Link to='/kirjaudu'>Kirjaudu</Link>
          </List.Item>
        </List>
      ) : (
        <List>
          <List.Item>
            <Link to='/'>Kasino</Link>
          </List.Item>
          <List.Item>
            <Link to='/saldo'>Saldo</Link>
          </List.Item>
          <List.Item>
            <Link to='/luotunnus'>Luo tunnus</Link>
          </List.Item>
          <List.Item>
            <Link to='/kirjaudu'>Kirjaudu</Link>
          </List.Item>
        </List>
      )}
    </div>
  );
};

export default MainNav;
